export const lightTheme = {
  body: "#fafafa",
  text: "#363537",
  toggleBorder: "#FFF",
  gradient:
    "linear-gradient(90deg, hsla(33, 100%, 53%, 1) 0%, hsla(58, 100%, 68%, 1) 100%)",
};

export const darkTheme = {
  body: "#333",
  text: "#FAFAFA",
  toggleBorder: "#6B8096",
  gradient: "linear-gradient(#091236, #1E215D)",
};
